import { Button } from 'primereact/button';
import { Calendar } from 'primereact/calendar';

import react, { useEffect, useState } from "react";

import { ReactDOM } from 'react';
import "./index.css";
import {ZodiacSignsDetail} from './data'; 
import Card from './card';
import Context from './Context';
import zodiacDetail from './zodiac'; 
import Zodiac from './zodiac';


function App(){
    const [date,setDate]=useState();

    
 

    return(
        

       
       <div className='main'>
       
       <div className='header'><h1>Zodiac Calendar</h1>
      
       </div>
       <div id='cal'>< Calendar className='cal' value={date} onChange={(e) => setDate(e.value)} /></div>
       
       <Context.Provider> <Card /> </Context.Provider>
      <div><Context.Provider><Zodiac /> </Context.Provider></div> 
   
      
       
            </div>

        
  
    );
    

}



export default App;
